INSERT INTO `rule` (`rule_id`, `rule_les_num`, `rule_ini`, `rule_title`, `rule`)
VALUES
	(1,1.0,'svs','Short Vowel Sounds','Short Vowel Sounds include:\n\nthe A in Dad\n\nthe O in Lock\n\nthe I in Dip\n\nthe E in Bed\n\nand the Y in Gym'),
	(2,1.1,'sa','Short A','You hear the \nshort A \nin words like \nRan\nBat\nand Back.'),
	(3,1.2,'so','Short O','You hear the \nshort O \nin words like \nPop\nGot\nand Rock'),
	(4,1.3,'si','Short I','You hear the \nshort I \nin words like \nPin\nBit\nand Rick\n'),
	(5,1.3,'su','Short U','You hear the \nshort U \nin words like \nRun\nBut\nand Buck'),
	(6,1.4,'se','Short E','You hear the \nshort E \nin words like \nRed\nBet\nand Peck'),
	(7,2.0,'blend','Consonant Blends','Consonant Blends\n\nWhen two or three consonants sounds are spoken together their sounds overlap and partly blend together. \n\nExamples: \n\nS-p in Spit . S-p-l in Split'),
	(8,2.0,'cs','Short Vowel in Closed Syllable','Short Vowel in Closed Syllable\n\nA single written vowel \nhas a short sound\nin a closed syllable. \n\nA syllable is closed\nwhen it ends with\na closing consonant \nor consonant team.\n\nExamples: \nat cat \netch fetch\nin pin\non Don\nup pup '),
	(9,2.1,'cla','Closed Syllable - Short A','A Closed Syllable with the Short /a/ Sound.\n\nA closed syllable is a syllable that ends with a closing consonant or consonant team.\n\nIn a closed syllable the letter A has the short /a/ sound. \n\nExamples: Ran . Had . Hat'),
	(10,2.2,'ck','CK Ending','The Ending /k/ Sound\n\nThe ending /k/ sound is written with the letters C-K after a single short vowel in one syllable words. \n\nExamples: \n\nBack . Pick  \n\nUse the letter K after other vowel sounds in one syllable words.\n\nExamples: \n\nBake . Beak . Book . Bark\n'),
	(11,2.2,'clo','Closed Syllable - Short O','A Closed Syllable with the Short /o/ Sound.\n\nA closed syllable is a syllable that ends with a closing consonant or consonant team.\n\nIn a closed syllable the letter O has the short /o/ sound. \n\nExamples: pop . cot . lock'),
	(12,2.3,'clu','Closed Syllable - Short U','A Closed Syllable with the Short /u/ Sound.\n\nA closed syllable has a single vowel followed by a closing consonant. In a closed syllable the letter U has the short /u/ sound. \n\nExamples: run . cut . luck'),
	(13,2.4,'cli','Closed Syllable - Short I','A Closed Syllable with the Short /i/ Sound.\n\nA closed syllable is a syllable that ends with a closing consonant or consonant team.\n\nIn a closed syllable the letter I has the short /i/ sound.\n\nExamples: pin . bit . pick'),
	(14,2.5,'cle','Closed Syllable - Short E','A Closed Syllable with the Short /e/ Sound.\n\nA closed syllable is a syllable that ends with a closing consonant or consonant team. \n\nIn a closed syllable the letter E has the short /e/ sound. \n\nExamples: \n\nPet . Met . Desk'),
	(15,2.6,'tcs','Two Closed Syllables','A closed syllable has a single vowel followed by a closing consonant. Words with two closed syllables act the same. \n\nExamples: Rabbit, Atom, Inlet'),
	(16,3.5,'ed','Three sounds of ED past tense ending.','ED Past Tense Suffix\nThe suffix E-D, which makes a verb past tense, has three ways to say it: \n1. /d/ when after a voiced sound. Example: Played\n2. /t/ when after a unvoiced sound. Example: Walked\n3. /ed/ after a T or D. \nExample: Wanted'),
	(17,4.0,'double','Double Final Single Consonant when adding Vowel Suffix','-V Suffix = Double C  - Double the last consonant when adding a vowel suffix to multi-syllable  words ending in one vowel followed by one consonant when the syllable before the suffix is accented'),
	(18,4.0,'es3p','ES Third Person','Suffix S, ES and 3rd Person  - To make a verb third person (he, she, it) add the ending S unless the word ends with an /s/, /z/, /ch/ or /s/ sound,  or if it changes the meaning of the word; then add E-S. Examples : Runs, Passes, Patches, Wishes, Does.'),
	(19,4.0,'esplural1','ES Plural Suffix','Suffix S, -ES as Plural To make a word plural add the ending S, unless the word end with the S, Z, CH or SH sound, or if it changes the meaning of the word; then add E-S. Examples: Hits, Boxes, Wishes.'),
	(20,4.1,'h','H Pairs','S-H . T-H . W-H\n\nS-H, T-H & W-H are not blends. They each represent one sound. \n\nExamples: \nSH in Shot and Dish,\nTH in Thing and With,\nWH in What and Why.'),
	(21,4.1,'sh-','Begining SH','SH at the beginning of any syllable after the first one, except for the ending -ship.'),
	(22,4.2,'endch','TCH & CH Endings','/ch/ Sound Endings\n\nAn ending /ch/ sound, after a single short vowel, is written with the letters T-C-H. \nExamples: Catch . Pitch\n\nBut after a long vowel sound, or a consonant, it is written with the letters C-H only. \n\nExamples: Peach . Torch'),
	(23,4.3,'endj','DGE & GE Endings','DGE & GE as /j/ Sound Endings\n\nEnglish words do not end with the letter J.\n \nInstead, use D-G-E after a short vowel. The letter D is used as a second consonant, along with the letter G, so that the word\'s short vowel will remain short. \nFudge (not \\fuge\").'),
	(24,4.4,'ks','The Two Sounds of X','The Letter X One Man Team\n\nAt the end of a base word the letter X becomes one letter with two sounds.\n\nThe /k/ Sound quickly followed by the /s/ Sound.\n\nExamples: Fox, Box'),
	(25,4.4,'qu','Q needs U','Q-U as /kw/ Sounds\n\nIn English words, the letter Q always has the letter U after it. \n\nTogether they make the /k/ and /w/ consonant sounds. \n\nWords in English that start with a /kw/ blend sound are always spelled with the letters Q-U. \n\nExamples: Quit, Queen.'),
	(26,4.5,'foot','The Put Foot Pattern','U & O-O Short /oo/ Sound Teams\n\nThe long /u/ sound can be written with the letter U, the letters E-W and the letters O-O. \n\n\nThe sound of U in \\Put\"can be written with the letter U and and with the letters O-O.  '),
	(27,4.5,'ng','NG','The /ng/ Sound\n\nThe /ng/ sound is one sound, and written with the letters N & G, at the ends of words.\n\nExamples: Sing, Bang, Running\n\nHowever, when the /ng/ sound is followed by the /k/ sound it is written with the letter N only.\n\nExamples: Sink, Bank'),
	(28,4.6,'flsz','Double Fizzle','FF . LL . SS . ZZ\n\nThe letters F, L, S and Z are doubled after a single short vowel in a closed syllable. \nThey are doubled but each pair have only one sound each. \nSometimes other letters are doubled as well. \n\nExamples: Stuff . Mill . Boss . Buzz'),
	(29,5.1,'ah','The All Saw Pa\'s Paunch Pattern','The /ah/ Sound\n\nThe /ah/ sound is usually written with the letters A-W at the end of a base word and with the letters A-U in the middle or the beginning of the word. \n\nExamples: Paw . Sauce\n\nAt the end of a one syllable word the /ah/ sound can sometimes be written with the letter A only.\n\nExamples: Ma . Pa\n\nThe letter A before LL, or after W, will have the /ah/ sound.\n\nExamples: Ball . Want . Water'),
	(30,5.2,'oy','The Soy Oil Pattern','The /oy/ sound is usually written with the letters O-Y at the end of a word and with the letters O-I in the middle or beginning of a word. \n\nExamples: Toy . Toil . Boy . Boil'),
	(31,5.3,'ow','The Count Cows Pattern','The /ow/ sound is usually written with the letters O-W at the end of a base word. \n\nExamples: Now . How\n\nIt is usually written with the letters O-U in the middle, or beginning, of a word. \n\nExamples: Noun . Hound'),
	(32,6.1,'r1','R Power 1 - E.R, I.R, U.R','The letter R, after a short vowel, blends with the vowel to make a new \\R-Controlled\"sound. E-R\"'),
	(33,6.2,'r2','R Power 2 - A.R, O.R','The letter R, after a short vowel, blends with the vowel to make a new \\R-Controlled\"sound. '),
	(34,6.3,'w','The Power of W','The letter W before A, A-R & O-R changes the vowel sound. \n\nThe short A sound changes to the AH sound. \n\nThe AR sound changes to an OR sound. \n\nThe OR sound changes to an ER sound. \n\nExamples: \n\nWant .  Warm .  Word'),
	(35,6.4,'ioCC','Long I & O Before Consonant Blends','Long /i/ & Long /o/ before N-D, L-D, S-T & L-T Blends.\n\nThe letters I and O, before the consonant blends N-D, L-D, S-T & L-T, often have the long /i/ and long /o/ sounds. \n\nExamples: Mild . Cold . Mind . Bolt'),
	(36,6.5,'softC','Soft C','The letter C before E, I, or Y makes the /s/ sound. \n\nExamples: Cent, City, Cyber.'),
	(37,6.6,'softG','Soft G','The letter G before E, I, or Y usually makes the J sound. \n\nExamples: Gem, Gin, Gym'),
	(38,7.1,'e1','Silent E makes Vowel Long','E Makes Short Vowel Long \n(The First Power of Silent E.) \n\nSilent E, after a closed syllable, changes a short vowel into a long vowel. The letter E is like a \\key\"that can \\\"\"open\\\"\" a  closed syllable. '),
	(40,7.3,'softGE','E makes G Soft','E Makes G Soft\n(The Second Power of Silent E.)\n\nSilent E can change the Hard G /g/ sound to the soft G /j/ sound.\n\nExamples: Gem . Gym . Range . Large'),
	(41,7.4,'e4','Consonant L-E','E Makes Ending Consonant-L Blend \\Legal\"'),
	(42,7.5,'ve','No V Ending','E Makes Ending V \\Legal\"- The Fifth Power of Silent E. '),
	(43,7.6,'se','E after S - Not Plural ','Ending E can be used after an S to make the word not look like a plural word. Examples: Tense, Tease.'),
	(44,8.0,'schwa','Schwa','o + w, th, m, n, v = Schwa - o can = Schwa in a stressed syllable next to w, th, m, n, v.'),
	(45,8.0,'svlo','A Single Long Vowel in an Open Syllable','A single vowel, in an open syllable, usually has the long sound. \nExcept one-syllable words ending in A, and sometimes O. \n\nExamples: \n\nLong I in I and By. \nLong O in No. \nLong A in Able. \nLong O in Open \nand long U in Unit.'),
	(46,8.6,'endy','Ending Y with Long E Sound','-y as Long I in one (open)-syllable word ending with y = Long I\n\n-y as long E sound. y = Long E at end of a multi-syllable base word.'),
	(47,8.6,'yiSuf','Y changes to I before Vowel Suffix','Suffix after Y - Change Y to I. Single vowel Y changes to Y when adding any ending, unless the ending begins with I.'),
	(48,9.1,'ay','The Rain Day Pattern','The A-Y & A-I Long /a/ Sound Teams\n\nThe long /a/ sound is usually written as A-Y at the end of a base word \nand as A-I in the middle or the beginning. \n\nExamples: \n\nPay . Pain . May . Main . Delay'),
	(49,9.2,'eplus','The Eat Eels Pattern','EE & EA Long /e/ Sound Teams\n\nThe letter E before the letter E\nor the letter E before the letter I both make the Long /e/ sound.\n\nExamples: Eel . Eat'),
	(50,9.3,'iplus','The Pie Fight Pattern','I-E & I-G-H Long /i/ Sound Teams\n\nThe letter I before the letter E \nor the letter I before the letters G-H have the Long /i/ sound. \n\nExamples: Pie . High'),
	(51,9.4,'oplus','The Toad Grow Toes Pattern','O before A, O before W and O before E can make the Long /O/ sound. \n\nExamples: Toad, Grow, Toe\n'),
	(52,9.5,'boot','The New Boot Pattern','Long U and E-W & O-O Long /u/ Sound Teams\n\nThe long /u/ sound can be written with the letter U, the letters E-W and the letters O-O. \n\nExamples: \n\nRule . New . Boot'),
	(53,9.5,'euew','The Dew Due Pattern','U-E & E-W /ew/ Sound Teams\n\nThe /ew/ sound can be written with the letters E-U and the letters E-W. \n\nExamples: Due . Few\n'),
	(54,9.5,'ueew','U before E or E before W','U before E or E before W makes the Long /U/ sound. \n\nExamples: Few, Due.'),
	(55,10.2,'iase','I with Long E Sound in Open Syllable','I with Long E Sound in Open Syllable'),
	(56,10.2,'opi','Open Syllable Long /i/ Sound','Open Syllable Long /i/ Sound\n\nIn multi-syllable (multisyllabic) words the long /i/ sound is most often written with the letter I in an open syllable.\n\nExamples: item . idea . multisyllabic \n'),
	(57,10.4,'ine','I.N.E. with Short I Sound\"','INE with Short I Sound '),
	(58,10.5,'ain','A.I.N. with Short I Sound','AIN with Short I Sound'),
	(59,11.1,'tion','T.I as SH Sound before O.N.','T-I in T-I-O-N with the /sh/ Sound Team\n\nThe letters T-I often have the /sh/ sound in T-I-O-N in multisyllabic words.\n\nExamples: Action . Nation . Administration'),
	(60,11.2,'sion','SI as SH Sound before O.N.','S-I in S-I-O-N with the /sh/ Sound Team\n\nThe letters S-I often have the /sh/ sound in S-I-O-N in multisyllabic words.\n\nExamples: Passion . Mission . Recession'),
	(61,11.3,'tu','TU (TURE) as CH Sound','When T is followed by UR in the middle of a word  the R sound changes the T to a CH as the tongue is pulled back in the mouth. Examples: nature . mutual . Legislature . \"'),
	(62,11.4,'phf','P.H as F Sound','PH as F Sound\n\nPH with an F sound coms to English from Greek. In ancient times it had a P sound but changed over time.\n\nExamples: phone . alphabet . triumph'),
	(63,11.5,'chsh','C.H as SH Sound','CH as SH Sound\n\nCH with an SH sound comes to English from French. French does not have the CH sound. It uses CH for the SH sound.\n\nExamples: chef . machine . brochure'),
	(64,11.6,'chk','CH as K Sound','CH as K Sound\n\nCH with an K sound comes to English from Greek. Greek does not have the CH sound nor the SH sound. But it does have the K sound.\n\nExamples: chaos . archive . stomach'),
	(65,12.1,'citi','C.I, T.I as SH Sound before O.U.S.','CI (CIOUS), TI (TIOUS) as SH Sound\n\nC-I  in C-I-O-U-S and T-I in T-I-O-U-S with the /sh/ Sound\n\nThe letters C-I and the letters T-I can have the /sh/ sound  in multisyllabic words that end with I-O-U-S.\n\nExamples: vicious . delicious . fictitious . nutritious'),
	(66,12.2,'ctian','CI, TI as SH Sound before A.N.','CI & TI as SH Sound before AN\n\nC-I & in C-I-A-N and T-I in T-I-A-N with the /sh/ Sound\n\nThe letters C-I and the letters T-I can have the /sh/ sound in C-I-A-N and in T-I-A-L multisyllabic words.\n\nExamples: Electrician . Magician . Martian'),
	(67,12.3,'ctial','CI, TI as SH Sound before A.L.','CI (CIAL) & TI (TIAL) as SH Sound\n\nC-I & in C-I-A-L and T-I in T-I-A-L with the /sh/ Sound\n\nThe letters C-I and the letters T-I can have the /sh/ sound in C-I-A-L and in C-I-A-L multisyllabic words.\n\nExamples: official . crucial . initial . partial'),
	(68,12.4,'ntial','TI as SH or CH Sound after N, before A.L.','T-I in N-T-I-A-L with the /sh/ Sound\n\nThe letters T-I can have the /ch/ sound in N-T-I-A-L in multisyllabic words.\n\nExamples: \n\nPotential . Preferential'),
	(69,12.5,'gesi','G.E, S.I, S.U. as Voiced ZH Sound','G-E, S-I, S-U as Voiced /sh/ Sound.\n\nG-E, S-I and S-U can make the Voiced SH Sound as in beige, vision and treasure.\n\nExamples: rouge . Asia . closure\n'),
	(70,13.1,'sil1','Silent Letters. g.N, G.h, G.u, h.O, k.N, p.S.','Silent Letters in gN, Gh, Gu, hO, kN, pS Teams\n\nG is silent when followed by N in the beginning of a word.\nExample: gnarl.\nH is silent when it comes after the letter G in the beginning of a word.\nExample: ghost.\nU is silent when it comes after the letter G in the beginning of a word. The silent U makes the letter G have the hard /g/ sound.\nExample: guest.\nH is silent when followed by O in the beginning of a word.\nExample: honest.\nK is silent when followed by N in the beginning of a word.\nExample: knee.\nP is silent when followed by S in the beginning of a word.\nExample: psychology.'),
	(71,13.2,'sil2','Silent Letters. S.c, S.w, w.H, w.R.','Silent Letters in Sc, Sw, wH & wR Teams\n\nC is silent when it comes after the letter S in the beginning of many words, or syllables, that come to English from Latin.\nExamples: science . obscene.\nW is occasionally silent when it comes after the letter S in the beginning of some words or syllables.\nExamples: sword . answer.\nW is silent when followed by H in the beginning of a word.\nExamples: whose . whole.\nW is silent when followed by R in the beginning of a word.\nExamples: write . wrist.'),
	(72,13.3,'sil3','Silent Letters. M.b, b.T, M.n, g.N.','Silent Letters in Mb, bT, Mn, gN Teams\n\nB is silent when it comes after the letter M at the end of words.\nExamples: climb . thumb.\nB is also silent when it comes before the letter T at the end of words.\nExamples: debt . doubt.\nG is silent when it comes before the letter N at the end of words.\nExamples: column . hymn.\nM is silent when it comes before the letter N at the end of words.\nExamples: sign . campaign.\n'),
	(73,13.4,'silLtr','Silent Letters. F.t, S.t, t.L.e, Q.u.e.','Silent Letters in Ft, St, tLe, Que Teams\n\nT is silent when it comes after the letter F in the middle of words.\nExamples: listen . often.\nT is also silent when it comes after the letter S in the middle of words.\nExamples: fasten . moisten.\nT is silent when it comes before the letters L and E at the end of words.\nExamples: castle . wrestle.\nU and E are often silent when they come after the letter Q at the end of words; words that typically come to English from French.\nExamples: antique . grotesque.'),
	(74,13.5,'sil5','Silent Letters. o.u.G.H.','O.U.G.H (F)\n\nIn Old English the letters GH were written for the sound \\KH\"which sounds like a K followed by an H made at the back of the mouth. '),
	(75,14.0,'vth','Voiced TH','th -e = voiced - e after th = voiced TH');
INSERT INTO `sec` (`sec_id`, `sec_num`, `sec_title`, `sec_desc`)
VALUES
	(1,1,'Keys','Keys is a systematic introduction to the keyboard, starting with the Home Row, and including all letter keys. In this section, the keys are matched individually with their most common sounds. The vowels are short. The C Key makes the ?k? sound, etc.'),
	(2,2,'Short Vowels','Short introduces the same sounds within real words; phoneme by phoneme. The first digraph (ck) is introduced, as well as, two syllable words with the suffixes s, es, ed, en and ic.'),
	(3,3,'Blends','Blends introduces words with consonant blends such as st-, tr-, sm-, dr-, -nd, etc.'),
	(4,4,'Consonant Teams','Consonant Teams introduces consonant teams such as sh, th. wh, ch, tch, dge, qu, x ng, as well as introducing the prefix mis-, in-, un- and Double Consonants before suffixes -ed and -ing (top /topped / topping).'),
	(5,5,'Vowel Teams','Vowel Teams introduces short vowel teams such as au, aw. oi, oy, ou, ow, oo, as well as introducing the prefixes: con-, dis-, ex-, ad-, an-, en-, em-, and the suffixes: -ful, -less, -ness, -ess, -let, -ive.'),
	(6,6,'Mixed Teams','Mixed Teams introduces vowel/consonant teams such as R-Controlled vowels (er, ir, ur, ar, or), W-Controlled (wa-, wor- war-), and Sort C and G, as well as introducing the prefixes: non-  and the suffixes: -er, -est, -ine.'),
	(7,7,'E Power','E Power introduces the powers of the letter E to influence the sounds of other letters. Silent E to make a short vowel long (mat -mate), make Cand G soft (dance, change), make L and V ?legal? (able and love).'),
	(8,8,'Long Vowels','Long Vowels focuses on long vowel sounds mostly in multisyllabic words and including long a,e,i,o,u and y (with long i or e sounds).\n'),
	(9,9,'Long Vowel Teams','Long Vowel Teams introduces on long vowel teams such as ai, ay, ee, ea, igh, ie, oe, ow, oa, ew, ue.)'),
	(10,10,'Expert Vowels','Vowels focuses on the less common vowel sound graphemes such as -a in Mama, -i- in radio, and -y in happy, -i-ne in examine and ?ai-n in certain.'),
	(11,11,'Expert Teams 1','Expert Teams 1 focusing on both consonant and consonant-vowel teams found mostly in multisyllabic words such as -ti-, -si-,ci with the sh sound.'),
	(12,12,'Expert Teams 2','Expert Teams 2 focusing on both consonant and consonant-vowel teams found mostly in multisyllabic words such as -ti-, -si-,ci with the sh sound, tu- and -ti- with the ch sound, ph with the f sound and ch with the sh and k sounds.'),
	(13,13,'Silent Letter Teams','Silent Letter Teams focuses silent letter teams such as gh in ghost, gu in guard, bt in debt, and ps in psychology.');
